import React, { Component } from 'react'

class MovieItem extends Component {
  constructor (props) {
    super(props)
    this.state = {
      title: null,
      year: null,
      type: null,
      imdbID: null
    }
  }

  componentDidMount () {
    const { title, year, type, imdbID } = this.props
    this.setState({
      title: title,
      year: year,
      type: type,
      imdbID: imdbID
    })
  }

  render () {
    const { movieItem } = this.state
    return (
      <div>
        {movieItem !== null ?
          <p>{movieItem.Title}</p> 
          : ''}
      </div>
    )
  }
}

export default MovieItem
